import React from 'react';


function add(a,b) {

    const y = a + b;

    return y;
}

function sub(a,b) {

    const y = a - b;

    return y;
}

function div(a, b) {

    const y = a / b;

    return y;
}

function multi(a, b) {

    const y = a * b;

    return y;
}
export default add;

export { sub,div,multi };
